  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The National Health Service Corps (NHSC)
  Jobs Center is a tool designed to make data and information concerning NHSC job
  vacancies more readily available to our users. It is intended to help doctors and
  nurses who are interested in working at areas where there is the highest need find
  out more about opportunities in a particular area or healthcare discipline. The
  tool also provides information on the work locations and area. Job opportunities
  can be searched and identified by a combination of search parameters. The user views
  the search results  on a map and as text and both views provide links to get more
  detailed information for each returned opportunity.</p>n\",\n\t\"license_title\":
